import React, { useState } from 'react';
import './Home.css';

function Home() {
  const [stations] = useState([
    {
      id: 1,
      name: 'Station 1',
      address: 'Dimona Industrial Area',
      city: 'Dimona',
      status: 'Available',
      waitTime: 0,
      location: { lat: 31.071, lng: 35.033 },
    },
    {
      id: 2,
      name: 'Station 2',
      address: 'Ein Bokek, Dead Sea',
      city: 'Dead Sea',
      status: 'Occupied',
      waitTime: 2,
      location: { lat: 31.200, lng: 35.364 },
    },
    {
      id: 3,
      name: 'Station 3',
      address: 'Yeruham Sonol Station',
      city: 'Yeruham',
      status: 'Available',
      waitTime: 1,
      location: { lat: 30.988, lng: 34.931 },
    },
    {
      id: 4,
      name: 'Station 4',
      address: 'Beer Sheva Central Bus Station',
      city: 'Beer Sheva',
      status: 'Occupied',
      waitTime: 3,
      location: { lat: 31.251, lng: 34.791 },
    },
    {
      id: 5,
      name: 'Station 5',
      address: 'Eilat City Center',
      city: 'Eilat',
      status: 'Available',
      waitTime: 0,
      location: { lat: 29.558, lng: 34.951 },
    },
  ]);

  const [searchQuery, setSearchQuery] = useState('');
  const [filteredStations, setFilteredStations] = useState(stations);
  const [suggestions, setSuggestions] = useState([]);
  const [showEmbeddedMap, setShowEmbeddedMap] = useState(false);

  const handleSearch = (query) => {
    setSearchQuery(query);

    const matches = stations
      .map((station) => station.city)
      .filter((city, index, array) => array.indexOf(city) === index)
      .filter((city) => city.toLowerCase().includes(query.toLowerCase()));

    setSuggestions(matches);

    const filtered = stations.filter(
      (station) =>
        station.city.toLowerCase().includes(query.toLowerCase()) ||
        station.address.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredStations(filtered);
  };

  const handleSuggestionClick = (suggestion) => {
    setSearchQuery(suggestion);
    setSuggestions([]);
    const filtered = stations.filter(
      (station) =>
        station.city.toLowerCase() === suggestion.toLowerCase() ||
        station.address.toLowerCase().includes(suggestion.toLowerCase())
    );
    setFilteredStations(filtered);
  };

  return (
    <div className="home-container">
      <header className="header">
        <h1 className="title">AC/DC Charging Stations</h1>
      </header>

      <div className="search-bar-container">
        <input
          type="text"
          placeholder="Search city or address..."
          value={searchQuery}
          onChange={(e) => handleSearch(e.target.value)}
          className="search-bar"
        />
        <button
          className="map-button"
          onClick={() => setShowEmbeddedMap(!showEmbeddedMap)}
        >
          {showEmbeddedMap ? 'Back to List' : 'View Map'}
        </button>
        {suggestions.length > 0 && (
          <ul className="suggestions-list">
            {suggestions.map((suggestion, index) => (
              <li
                key={index}
                onClick={() => handleSuggestionClick(suggestion)}
                className="suggestion-item"
              >
                {suggestion}
              </li>
            ))}
          </ul>
        )}
      </div>

      {showEmbeddedMap ? (
        <div className="map-container">
          <iframe
            src="https://www.google.com/maps/d/u/0/embed?mid=1apUlJ2dUs9n4Q4fLHsDRH8vLnM0ObsM&ehbc=2E312F"
            width="100%"
            height="480"
            style={{ border: 0 }}
            allowFullScreen
            loading="lazy"
            title="Charging Stations Map"
          ></iframe>
        </div>
      ) : (
        <div className="station-list">
          {filteredStations.map((station) => (
            <div key={station.id} className="station-card">
              <h3 className="station-name">{station.name}</h3>
              <p className="station-address">{station.address}</p>
              <p className={`station-status ${station.status.toLowerCase()}`}>
                {station.status === 'Available' ? 'Available' : 'Occupied'}
              </p>
              <p className="station-wait-time">
                <strong>Wait Time:</strong> {station.waitTime} people waiting
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default Home;
